def huber(x, min_priority=0.01):
    """Huber loss function.
    Args:
        x: The input tensor.
        min_priority: The minimum priority.
    Returns:
        The huber loss.
    """
    return th.where(x < min_priority, 0.5 * x.pow(2), min_priority * x).mean()
